// PieChart.tsx
import React from 'react';
import Highcharts from 'highcharts';
import HighchartsReact from 'highcharts-react-official';

const ColumnChart: React.FC = () => {
  const colOptions: Highcharts.Options = {
    chart: {
        type: 'column'
      },
      xAxis: {
        categories:['Jan','Jan','Jan','Jan','Jan','Jan','Jan','Jan','Jan','Jan','Jan','Jan',]
      },
      yAxis: {
        title :{
            text: 'Values'
        }
      },
      series :[
        {
            type:'column',
            name:'Unemployed',
            data: [2394,5454,4343,3442,4554,1211,3232,4333,3232,1212]
        }
        // {name:'Series 1',data:[10,20,30]}
      ]
  }
  return (
    <div className="">
      <HighchartsReact highcharts={Highcharts} options={colOptions} />
    </div>
  );
};

export default ColumnChart;
